//dzielenie map na tablice dwuwymiarowe (pozycja x i y)
Array.prototype.parse2d = function (rowLength) {
    let tab1 = [];

    for (let i = 0; i < this.length; i += rowLength) {
        tab1.push(this.slice(i, i + rowLength));
    }
    return tab1;
}